import React from 'react'

export default function CanvasButton(props){
  let icon = `fas fa-${props.icon}`
  return <button className="canvas-button" onClick={props.onClick}>
    <i class={icon}></i>
    {/* <i class="">{props.icon}</i> */}
  </button>
}
